import React from 'react';

import axios from 'axios';

export default class List extends React.Component {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.get(`http://138.68.251.108:9200/retailpoc/_search?pretty`)
      .then(res => {
        console.log(res.data.hits.hits);
        const persons = res.data.hits.hits;
        this.setState({ persons });
      })
  }

  render() {
    return (
      // <ul>
      //   { this.state.persons.map(person => <li>{person._source.catalogItem.transactions.transactionId}</li>)}
      // </ul>


<div /* style={{width: '100%', boxSizing: 'border-box', padding: 8}} */>
<table style={{width: '100%', boxSizing: 'border-box'}}>
  <thead>
    <tr>
      <th>Retail Store</th> 
      <th>Customer ID </th> 
      <th>Transaction ID </th> 
      <th>Transaction Time</th>
      <th>Product ID</th>
      <th>Cost</th>
    </tr>
  </thead>
  <tbody>
    <tr key={ this.state.persons.map(person => person._id)}>            
     <td>{ this.state.persons.map(person => person._source.catalogItem.retailStore)} </td> 
     <td>{ this.state.persons.map(person => person._source.catalogItem.customerId)} </td> 
     <td>{ this.state.persons.map(person => person._source.catalogItem.transactions.transactionId)} </td> 
     <td>{ this.state.persons.map(person => person._source.catalogItem.transactions.transactionTime)} </td> 
     <td>{ this.state.persons.map(person => person._source.catalogItem.transactions.productId)} </td> 
     <td>{ this.state.persons.map(person => person._source.catalogItem.transactions.cost)} </td> 
    </tr>

    </tbody>
</table>
</div>
    )
  }
}
